import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { CarInspectionResults } from './components/CarInspectionResults'; 
import { TodoWrapper } from './components/TodoWrapper'; 

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Car Inspection Results Page */}
          <Route path="/" element={<CarInspectionResults />} />

          {/* TodoWrapper Page */}
          <Route path="/add-inspection" element={<TodoWrapper />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
